import React from "react";
import Navbar from "../components/Navbar";

export default function () {
  return (
    <>
      <div>
        <div className=" min-h-screen bg-[#205AFC]">
          <Navbar />
          {/* Hero Section */}
          <section className="relative w-full min-h-screen md:h-screen md:block flex-col justify-center"></section>
        </div>
        {/* About */}
        <div>Test</div>
      </div>
    </>
  );
}
